import "./App.css";

function App() {
  return (
    <div className="main">
      <div className="header">
        <div className="info">
          <span>Header/info</span>
          <div className="display">
            <p>Info display</p>
          </div>
        </div>
        <div className="master-control">
          <p>Master control section</p>
        </div>
      </div>
      <div className="seq">
        <p>Body and seq</p>
      </div>
    </div>
  );
}

export default App;
